class Observable:
    def __init__(self):
        self._observers = []

    def add_observer(self, observer):
        self._observers.append(observer)

    def notify_observers(self, message):
        for observer in self._observers:
            observer.update(message)

class MusicModel(Observable):
    def __init__(self):
        super().__init__()
        self.artists = artists
        self.song_paths = song_paths
        self.song_images = song_images
        self.current_track = None

    def get_artists(self):
        return self.artists

    def get_songs_by_artist(self, artist):
        return self.artists.get(artist, [])

    def play_track(self, track):
        self.current_track = track
        self.notify_observers(f"Now playing: {track}")

    def get_current_track(self):
        return self.current_track

    def get_song_image(self, track):
        return self.song_images.get(track, "default_image_url")

class State:
    def play(self, player):
        raise NotImplementedError("Play method not implemented")

    def pause(self, player):
        raise NotImplementedError("Pause method not implemented")

    def stop(self, player):
        raise NotImplementedError("Stop method not implemented")

class PlayingState(State):
    def play(self, player):
        return {"message": "Already playing"}

    def pause(self, player):
        player.state = player.paused_state
        return {"message": "Paused"}

    def stop(self, player):
        player.state = player.stopped_state
        player.model.current_track = None
        return {"message": "Stopped"}

class PausedState(State):
    def play(self, player):
        player.state = player.playing_state
        return {"message": f"Now playing: {player.model.get_current_track()}"}

    def pause(self, player):
        return {"message": "Already paused"}

    def stop(self, player):
        player.state = player.stopped_state
        player.model.current_track = None
        return {"message": "Stopped"}

class StoppedState(State):
    def play(self, player):
        if player.model.get_current_track():
            player.state = player.playing_state
            return {"message": f"Now playing: {player.model.get_current_track()}"}
        return {"message": "No track selected"}

    def pause(self, player):
        return {"message": "Cannot pause when stopped"}

    def stop(self, player):
        return {"message": "Already stopped"}

class MusicPlayer:
    def __init__(self, model):
        self.model = model
        self.playing_state = PlayingState()
        self.paused_state = PausedState()
        self.stopped_state = StoppedState()
        self.state = self.stopped_state

    def play(self):
        return self.state.play(self)

    def pause(self):
        return self.state.pause(self)

    def stop(self):
        return self.state.stop(self)

# Initialize model and player
model = MusicModel()
player = MusicPlayer(model)

