    songs = artists.get(artist, [])
    artist_name = artist.replace('_', ' ').title()
    return render_template('songs.html', artist_name=artist_name, songs=[{"title": song, "path": url_for('static', filename=f'songs/{artist}/{song.replace(" ", "_")}.mp3')} for song in songs])

