EXCEL_FILE = 'feedback.xlsx'

@app.route('/feedback', methods=['GET', 'POST'])
def feedback():
    if request.method == 'POST':
        name = request.form['name']
        email = request.form['email']
        message = request.form['message']
        date_submitted = datetime.now().strftime('%Y-%m-%d %H:%M:%S')

        # Create a new DataFrame with the feedback
        new_feedback = pd.DataFrame([[name, email, message, date_submitted]], 
                                    columns=['Name', 'Email', 'Message', 'Date Submitted'])

        # Check if the Excel file already exists
        if os.path.exists(EXCEL_FILE):
            df = pd.read_excel(EXCEL_FILE)
            df = pd.concat([df, new_feedback], ignore_index=True)
        else:
            df = new_feedback

        # Save the DataFrame to the Excel file
        df.to_excel(EXCEL_FILE, index=False)

        return 'Feedback submitted successfully!'
    return render_template('feedback.html')



